// src/components/Frame5.js
import React from "react";
import { Link } from "react-router-dom";
import "../styles.css"; 

function Frame5() {
  return (
    <div className="frame5"style={{marginTop: "-80px"}}>
      <div className="textArbitrageNotFound">
        No Arbitration Opportunities Found :(
      </div>
      {/* "More Sports" as a clickable link */}
      <Link className="textMoreSports" to="/frame3">
        More Sports
      </Link>
    </div>
  );
}

export default Frame5;
